import { createMuiTheme, ThemeProvider } from "@material-ui/core/styles";
import { green, orange } from "@material-ui/core/colors";

const Theme = createMuiTheme({
  palette: {
    primary: {
      main: "rgb(120, 169, 152);"
    },
    secondary: {
      main: green[300]
    },
    error: {
      main: "#e57373"
    },
    warning: {
      main: "#ffb74d"
    },
    info: {
      main: "#2196f3"
    },
    success: {
      main: "#81c784"
    }
  }
});

export default Theme;
